import React, { useRef, useState } from "react";
import "./styles/App.css";

const App = () => {
  return (
    <div className="App">
      <h1>Shop order</h1>
      <div>
        <h2>Categories:</h2>
        <div>Burgers</div>
        <div>Pizza</div>
        <div>Pasta</div>
        <div>Sushi</div>
        <div>Salats</div>
      </div>
    </div>
  );
};

export default App;
